import React from 'react';

const AudioRecord = ({ onNewRecord }) => {
  const addRecord = () => {
    const newRecord = {
      name: 'Catchup Meeting', // Placeholder name
      date: new Date().toISOString().slice(0, 10), // Today's date
      isEditable: true // Flag to indicate this is an editable record
    };
    onNewRecord(newRecord);
  };

  return (
    <button onClick={addRecord}>Record Audio</button>
  );
};

export default AudioRecord;
